import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

function Home() {
  const [transactions, setTransactions] = useState([]);
  const [summary, setSummary] = useState({ totalIncome: 0, totalExpenses: 0, balance: 0 });
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  useEffect(() => {
    const userId = localStorage.getItem('userId'); // You'll need to store userId during login
    if (!userId) {
      navigate('/login');
      return;
    }

    // Fetch transactions and summary
    const fetchData = async () => {
      try {
        const [transactionsRes, summaryRes] = await Promise.all([
          fetch(`http://localhost:4000/api/transactions/${userId}`),
          fetch(`http://localhost:4000/api/summary/${userId}`)
        ]);

        const transactionsData = await transactionsRes.json();
        const summaryData = await summaryRes.json();

        if (transactionsData.success) {
          setTransactions(transactionsData.transactions);
        }
        if (summaryData.success) {
          setSummary(summaryData.summary);
        }
      } catch (err) {
        console.error('Error fetching data:', err);
      }
      setLoading(false);
    };

    fetchData();
  }, [navigate]);

  if (loading) {
    return <div>Loading...</div>;
  }

  return (
    <div className="home-container">
      <h1>Financial Dashboard</h1>

      {/* Summary Section */}
      <div className="summary-cards">
        <div className="card income">
          <h3>Total Income</h3>
          <p>${summary.totalIncome.toFixed(2)}</p>
        </div>
        <div className="card expenses">
          <h3>Total Expenses</h3>
          <p>${summary.totalExpenses.toFixed(2)}</p>
        </div>
        <div className="card balance">
          <h3>Balance</h3>
          <p>${summary.balance.toFixed(2)}</p>
        </div>
      </div>

      {/* Recent Transactions */}
      <div className="transactions-section">
        <h2>Recent Transactions</h2>
        {transactions.length === 0 ? (
          <p>No transactions found.</p>
        ) : (
          <table className="transactions-table">
            <thead>
              <tr>
                <th>Date</th>
                <th>Description</th>
                <th>Category</th>
                <th>Type</th>
                <th>Amount</th>
              </tr>
            </thead>
            <tbody>
              {transactions.map(transaction => (
                <tr key={transaction.id}>
                  <td>{new Date(transaction.date).toLocaleDateString()}</td>
                  <td>{transaction.description}</td>
                  <td>{transaction.category}</td>
                  <td className={transaction.type}>{transaction.type}</td>
                  <td className={transaction.type}>
                    ${transaction.amount.toFixed(2)}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
}

export default Home;
